window.bookSummaryJSON = "<p><b>This title will be streaming in Audible Plus through September 1st, 2021. </b></p> <p>A tournament approaches.&nbsp;&nbsp;&nbsp;</p> <p>All around the world, great clans and sects prepare their disciples to fight against one another in a competition of young Underlords.&nbsp;</p> <p>Even the Blackflame Empire is drawn in, but their youth are not strong enough to compete.&nbsp;&nbsp;&nbsp;</p> <p>Yet.&nbsp;</p> <p>To temper and test them, the Akura clan throws all the elites of the Blackflame Empire into a lush training ground. There, training will be much faster and more rewarding.&nbsp;</p> <p>Lindon and his team are only too eager to milk everything they can out of this opportunity, even when doing so means making new enemies.&nbsp;</p> <p>The only winners will be those who reach Underlord.&nbsp;&nbsp;</p>"; 
